import React from 'react';
import './App.css';
import { useState } from 'react';
import Form from './components/Form';

function App() {

  const [json, setJSON] = useState([])

  useEffect(()=>{
    fetch('http://localhost:8080/api/livros',{method:'GET'})
    .then(response => response.json())
    .then((data)=>{
      setJSON(data);})
    .catch((err)=> console.log(err))
  },[])

  if(json[0]== undefined){
    return <h4>Carregando ...</h4>
  }


  return (
    <div className="App">

     <Livro livrosJSON = {json}/>

    </div>
  );
}

export default App;
